Привет всем! Проектируем Windows приложение. Оно будет состоять из набора модулей, которые будут друг с другом практически не связаны (по сути - разные приложения внутри одного). Требования к решению:
    * Распределение разработки разных модулей между разными программистами; при этом отдельный программист не должен иметь доступа к исходномку коду модулей, над которыми он не работает;
    * В будущем может появиться необходимость перенести решение в веб; хотелось бы минимизировать телодвижения при такой реализации;

Планируем использовать WPF MVVM. А что бы вы посоветовали? И интересно - какие есть минусы у данного варианта?

